import React,  { Component } from 'react';
import Card from './Card';
import './App.css';

class App extends Component {
  constructor (props) {
    super (props); 

    this.state = {
      cardState : 0  // 0 , 1 , 2
    }
  }

  render () {
    return (
      <div className="App">
      <table>
      <tr>
